import React, { Component } from 'react'
import { Button, NavItem, NavLink } from 'react-bootstrap'

class Navbar extends Component {
    render() {
        return(
            <nav>
                <NavItem>
                    <NavLink>Home</NavLink>
                </NavItem>
                <NavItem>
                    <NavLink>Portf</NavLink>
                </NavItem>
            </nav>
        )
    }
}

export default Navbar
